import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { 
  Search, 
  Filter, 
  BookOpen, 
  Star, 
  TrendingUp, 
  Users,
  Clock,
  AlertCircle,
  CheckCircle,
  ChevronDown
} from 'lucide-react';

const PageContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  padding: 2rem 0;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 1rem;
`;

const PageHeader = styled.div`
  text-align: center;
  margin-bottom: 3rem;
  color: white;
`;

const PageTitle = styled.h1`
  font-size: 3rem;
  font-weight: 700;
  margin-bottom: 1rem;
  background: linear-gradient(135deg, #ffffff 0%, #f0f9ff 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const PageSubtitle = styled.p`
  font-size: 1.25rem;
  opacity: 0.9;
  max-width: 600px;
  margin: 0 auto;
  line-height: 1.6;
`;

const ContentCard = styled.div`
  background: rgba(255, 255, 255, 0.95);
  backdrop-filter: blur(10px);
  border-radius: 1.5rem;
  padding: 2rem;
  box-shadow: 0 20px 40px -10px rgba(0, 0, 0, 0.3);
  border: 1px solid rgba(255, 255, 255, 0.2);
`;

const SearchSection = styled.div`
  display: flex;
  gap: 1rem;
  margin-bottom: 2rem;
  flex-wrap: wrap;
`;

const SearchInput = styled.div`
  flex: 1;
  min-width: 300px;
  position: relative;
`;

const Input = styled.input`
  width: 100%;
  padding: 1rem 1rem 1rem 3rem;
  border: 1px solid #e2e8f0;
  border-radius: 0.75rem;
  font-size: 1rem;
  transition: all 0.2s ease;

  &:focus {
    outline: none;
    border-color: #667eea;
    box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
  }
`;

const SearchIcon = styled.div`
  position: absolute;
  left: 1rem;
  top: 50%;
  transform: translateY(-50%);
  color: #9ca3af;
`;

const FilterButton = styled.button`
  background: #f8fafc;
  border: 1px solid #e2e8f0;
  padding: 1rem 1.5rem;
  border-radius: 0.75rem;
  cursor: pointer;
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-weight: 500;
  color: #374151;
  transition: all 0.2s ease;

  &:hover {
    background: #f1f5f9;
    border-color: #cbd5e0;
  }
`;

const CoursesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(350px, 1fr));
  gap: 1.5rem;
  margin-top: 2rem;
`;

const CourseCard = styled(motion.div)`
  background: white;
  border: 1px solid #e2e8f0;
  border-radius: 1rem;
  padding: 1.5rem;
  transition: all 0.2s ease;
  cursor: pointer;

  &:hover {
    box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1);
    transform: translateY(-2px);
  }
`;

const CourseHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: start;
  margin-bottom: 1rem;
`;

const CourseCode = styled.div`
  font-size: 1.25rem;
  font-weight: 700;
  color: #1a202c;
`;

const CourseCredits = styled.div`
  background: #667eea;
  color: white;
  padding: 0.25rem 0.75rem;
  border-radius: 1rem;
  font-size: 0.875rem;
  font-weight: 600;
`;

const CourseTitle = styled.h3`
  font-size: 1.125rem;
  font-weight: 600;
  color: #374151;
  margin-bottom: 0.75rem;
  line-height: 1.4;
`;

const CourseDescription = styled.p`
  color: #6b7280;
  font-size: 0.875rem;
  line-height: 1.5;
  margin-bottom: 1rem;
`;

const CourseMeta = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
  margin-bottom: 1rem;
`;

const CourseTag = styled.div`
  background: ${props => {
    switch (props.category) {
      case 'Core CS': return '#dbeafe';
      case 'Math': return '#fef3c7';
      case 'Science': return '#dcfce7';
      case 'General Education': return '#f3e8ff';
      case 'Elective': return '#fce7f3';
      default: return '#f1f5f9';
    }
  }};
  color: ${props => {
    switch (props.category) {
      case 'Core CS': return '#1e40af';
      case 'Math': return '#92400e';
      case 'Science': return '#166534';
      case 'General Education': return '#7c3aed';
      case 'Elective': return '#be185d';
      default: return '#475569';
    }
  }};
  padding: 0.25rem 0.75rem;
  border-radius: 1rem;
  font-size: 0.75rem;
  font-weight: 600;
  text-transform: uppercase;
`;

const CourseStats = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1rem;
  margin-bottom: 1rem;
`;

const StatItem = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-size: 0.875rem;
  color: #64748b;
`;

const StatIcon = styled.div`
  width: 20px;
  height: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const DifficultyBadge = styled.div`
  background: ${props => {
    switch (props.level) {
      case 'Easy': return '#dcfce7';
      case 'Medium': return '#fef3c7';
      case 'Hard': return '#fed7aa';
      case 'Very Hard': return '#fecaca';
      default: return '#f1f5f9';
    }
  }};
  color: ${props => {
    switch (props.level) {
      case 'Easy': return '#166534';
      case 'Medium': return '#92400e';
      case 'Hard': return '#c2410c';
      case 'Very Hard': return '#dc2626';
      default: return '#475569';
    }
  }};
  padding: 0.25rem 0.75rem;
  border-radius: 1rem;
  font-size: 0.75rem;
  font-weight: 600;
  text-transform: uppercase;
  display: inline-block;
`;

const PrerequisitesList = styled.div`
  margin-top: 1rem;
  padding-top: 1rem;
  border-top: 1px solid #e2e8f0;
`;

const PrerequisitesTitle = styled.div`
  font-size: 0.875rem;
  font-weight: 600;
  color: #374151;
  margin-bottom: 0.5rem;
`;

const PrerequisitesItems = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 0.5rem;
`;

const PrerequisiteTag = styled.span`
  background: #f1f5f9;
  color: #475569;
  padding: 0.25rem 0.5rem;
  border-radius: 0.25rem;
  font-size: 0.75rem;
  font-weight: 500;
`;

const EmptyState = styled.div`
  text-align: center;
  padding: 4rem 2rem;
  color: #64748b;
`;

const EmptyStateIcon = styled.div`
  width: 80px;
  height: 80px;
  background: #f1f5f9;
  border-radius: 1rem;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0 auto 1.5rem;
  color: #94a3b8;
`;

const EmptyStateTitle = styled.h3`
  font-size: 1.5rem;
  font-weight: 600;
  margin-bottom: 1rem;
  color: #374151;
`;

const EmptyStateDescription = styled.p`
  font-size: 1.125rem;
  line-height: 1.6;
  max-width: 400px;
  margin: 0 auto;
`;

const LoadingState = styled.div`
  text-align: center;
  padding: 4rem 2rem;
`;

function Courses() {
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [filterCategory, setFilterCategory] = useState('All');

  useEffect(() => {
    fetchCourses();
  }, []);

  const fetchCourses = async () => {
    try {
      setLoading(true);
      const response = await fetch('/api/courses');
      if (response.ok) {
        const data = await response.json();
        setCourses(data);
      }
    } catch (error) {
      console.error('Error fetching courses:', error);
    } finally {
      setLoading(false);
    }
  };

  const filteredCourses = courses.filter(course => {
    const matchesSearch = course.courseCode.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         course.title.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = filterCategory === 'All' || course.category === filterCategory;
    return matchesSearch && matchesCategory;
  });

  const categories = ['All', 'Core CS', 'Math', 'Science', 'General Education', 'Elective'];

  if (loading) {
    return (
      <PageContainer>
        <Container>
          <PageHeader>
            <PageTitle>Course Catalog</PageTitle>
            <PageSubtitle>
              Explore all available Computer Science courses at UH
            </PageSubtitle>
          </PageHeader>
          <ContentCard>
            <LoadingState>
              <div className="loading" style={{ margin: '0 auto' }} />
              <p style={{ marginTop: '1rem' }}>Loading courses...</p>
            </LoadingState>
          </ContentCard>
        </Container>
      </PageContainer>
    );
  }

  return (
    <PageContainer>
      <Container>
        <PageHeader>
          <PageTitle>Course Catalog</PageTitle>
          <PageSubtitle>
            Explore all available Computer Science courses at UH
          </PageSubtitle>
        </PageHeader>

        <ContentCard>
          <SearchSection>
            <SearchInput>
              <SearchIcon>
                <Search size={20} />
              </SearchIcon>
              <Input
                type="text"
                placeholder="Search courses by code or title..."
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </SearchInput>
            <FilterButton>
              <Filter size={20} />
              Filter by Category
              <ChevronDown size={16} />
            </FilterButton>
          </SearchSection>

          {filteredCourses.length === 0 ? (
            <EmptyState>
              <EmptyStateIcon>
                <BookOpen size={40} />
              </EmptyStateIcon>
              <EmptyStateTitle>No Courses Found</EmptyStateTitle>
              <EmptyStateDescription>
                Try adjusting your search terms or filters to find the courses you're looking for.
              </EmptyStateDescription>
            </EmptyState>
          ) : (
            <CoursesGrid>
              {filteredCourses.map((course, index) => (
                <CourseCard
                  key={course._id || index}
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.3, delay: index * 0.05 }}
                  whileHover={{ scale: 1.02 }}
                >
                  <CourseHeader>
                    <CourseCode>{course.courseCode}</CourseCode>
                    <CourseCredits>{course.creditHours} cr</CourseCredits>
                  </CourseHeader>

                  <CourseTitle>{course.title}</CourseTitle>
                  <CourseDescription>{course.description}</CourseDescription>

                  <CourseMeta>
                    <CourseTag category={course.category}>
                      {course.category}
                    </CourseTag>
                    <CourseTag category="Level">
                      {course.level}
                    </CourseTag>
                    <DifficultyBadge level={course.difficultyLevel}>
                      {course.difficultyLevel}
                    </DifficultyBadge>
                  </CourseMeta>

                  <CourseStats>
                    <StatItem>
                      <StatIcon>
                        <Star size={16} />
                      </StatIcon>
                      GPA: {course.averageGPA || 'N/A'}
                    </StatItem>
                    <StatItem>
                      <StatIcon>
                        <Users size={16} />
                      </StatIcon>
                      {course.totalStudents || 0} students
                    </StatItem>
                    <StatItem>
                      <StatIcon>
                        <Clock size={16} />
                      </StatIcon>
                      {course.estimatedWorkload}
                    </StatItem>
                    <StatItem>
                      <StatIcon>
                        <TrendingUp size={16} />
                      </StatIcon>
                      {course.offeredSemesters?.join(', ') || 'N/A'}
                    </StatItem>
                  </CourseStats>

                  {course.prerequisites && course.prerequisites.length > 0 && (
                    <PrerequisitesList>
                      <PrerequisitesTitle>Prerequisites:</PrerequisitesTitle>
                      <PrerequisitesItems>
                        {course.prerequisites.map((prereq, prereqIndex) => (
                          <PrerequisiteTag key={prereqIndex}>
                            {prereq}
                          </PrerequisiteTag>
                        ))}
                      </PrerequisitesItems>
                    </PrerequisitesList>
                  )}
                </CourseCard>
              ))}
            </CoursesGrid>
          )}
        </ContentCard>
      </Container>
    </PageContainer>
  );
}

export default Courses;
